import React from 'react'

const FAQ = (faq, index) => {
    return (
        <div 

            className={"faq" + (faq.open ? 'open' : '')} 
            key={index}
        >
            <div className="faq-question">
                {faq.question}
            </div>

        </div>
    )
}

export default FAQ
